import React, { useEffect, useState } from 'react';
import { connect } from 'react-redux';

import TodoActions from './store/Actions/index';
import { Link } from 'react-router-dom';

function mapStateToProps(state) {
	return {
		todos: state.todos
	};
}

function mapDispatchToProps(dispatch) {
	return {
		// delete: (id) => {
		//     return dispatch(TodoActions.Delete(id))
		// },
		delete: (id) => {
			return dispatch({ type: 'DELETE', payload: id });
		},
		// edit: (obj) => dispatch(TodoActions.Edit(obj))
		edit: (obj) => dispatch({ type: 'EDIT', payload: obj })
	};
}

const List = (props) => {
	const dummyData = [{ name: "x", phoneNumber: '3', association: 'realme', status: 'approved', month: 'July', year: '2020', email: '1@gmail.com' },
	{ name: "y", phoneNumber: '65', association: 'samsung', status: 'disapproved', month: 'June', year: '2019', email: '2@gmail.com' },
	{ name: "z", phoneNumber: '53', association: 'huwaie', status: 'notUpload', month: 'Aug', year: '2018', email: '3@gmail.com' },
	{ name: "t", phoneNumber: '87', association: 'iphone', status: 'decline', month: 'Feb', year: '2017', email: '4@gmail.com' },
	{ name: "m", phoneNumber: '98', association: 'oppo', status: 'pending', month: 'Sept', year: '2016', email: '5@gmail.com' }
	]

	let [todos, setTodos] = useState([])
	useEffect(() => {
		fetch('https://jsonplaceholder.typicode.com/users')
			.then(response => response.json())
			.then(data => {
				console.log(data)
				setTodos(data)
			})
	}, [])
	let rows = dummyData.map((item, i) => (
		<tr key={i}>
			<td>{i}</td>
			<td>{item.name}</td>
			<td>{item.phoneNumber}</td>
			<td>{item.association}</td>
			<td>{item.month}</td>
			<td>{item.year}</td>
			<td>{item.email}</td>
			<td>{item.status}</td>

		</tr>
	));
	const handleStatusChange = () => {

	}
	const handleAssociationChange = () => {

	}
	const handleMonthChange = () => {

	}
	return (
		<div>
			<div>
				<label>
					Status
				 <select
						id="status"
						name="status"
						onChange={handleStatusChange}

					>
						<option>Approve</option>
						<option>Disapproved</option>
						<option>Decline</option>
						<option>Not uploaded</option>

					</select>
				</label>
				<label>
					Association
				 <select
						id="association"
						name="association"
						onChange={handleAssociationChange}

					>
						<option value="samsung">Samsung</option>
						<option value="iphone">iPhone</option>
						<option value="huawie">Huawie</option>
						<option value="oppo">Oppo</option>
						<option value="realme">Realme</option>
					</select>
				</label>
				<label>
					Month
				 <select
						id="month"
						name="month"
						onChange={handleMonthChange}

					>
						<option value="jan" >Jan</option>
						<option value="feb" >Feb</option>
						<option value="march" >March</option>
						<option value="april" >April</option>
						<option value="may">May</option>
						<option value="june">June</option>
						<option value="july">July</option>
						<option value="aug">August</option>
						<option value="sep">September</option>
						<option value="oct">October</option>
						<option value="nov">November</option>
						<option value="dec">December</option>
					</select>
				</label>
				<label>
					Year
				 <select
						id="year"
						name="year"
						onChange={handleYearChange}

					>
						<option value="2020">2020</option>
						<option value="2019">2019</option>
						<option value="2018">2018</option>
						<option value="2017">2017</option>
						<option value="2016">2016</option>
					</select>
				</label>

			</div>
			<table>
				<thead>
					<tr>
						<th>S.no</th>
						<th>Name</th>
						{/* <th>Class</th> */}
						<th></th>
					</tr>
				</thead>
				<tbody>{rows}</tbody>
			</table>
			<Link to="/input">
				<button className="button">Create Todo</button>
			</Link>
		</div>
	);
};

export default connect(mapStateToProps, mapDispatchToProps)(List);
